import React  from 'react';
import { Link } from 'react-router-dom'

class Login extends React.Component {
  constructor() {
    super();
    this.state = {
      email: '',
      password: '',
    }
  }



  render() {
    return(
      <form>
        <label htmlFor="email">
          e-mail
          <input type="email" id="email" />
        </label>
        <label htmlFor="senha">
          senha
          <input type="password" id="senha" />
        </label>
        <Link to='/users'><button type='button'>Entrar</button></Link>
      </form>
    );
  }
}

export default Login;
